# -*- coding: UTF-8 -*-
import zipfile
import requests
import base64


def download_handler(url, file_path):
    """
    下载文件
    :param url: 文件url
    :param file_path: 带有文件名的完整路径
    :return:
    """
    headers = {
        "User-Agent": "Mozilla/5.0 (Windows NT 10.0; WOW64; rv:68.0) Gecko/20100101 Firefox/68.0"
    }
    r = requests.get(url=url, headers=headers)
    with open(file_path, "wb") as f:
        f.write(r.content)
        f.flush()


def unzip_file(zip_src, dst_dir):
    """
    解压zip文件
    :param zip_src:
    :param dst_dir:
    :return:
    """
    r = zipfile.is_zipfile(zip_src)
    if r:
        fz = zipfile.ZipFile(zip_src, 'r')
        for file in fz.namelist():
            fz.extract(file, dst_dir)
    else:
        print('This is not zip')


def string_to_base64(s):
    """
    base64转字符串文本
    :param s:
    :return:
    """
    return base64.b64encode(s.encode('utf-8'))


def base64_to_string(b):
    """
    文本转base64
    :param b:
    :return:
    """
    return base64.b64decode(b).decode('utf-8')


def read_file(file_path):
    """
    读取文本内容
    :param file_path:
    :return:
    """
    file = open(file_path, mode='r', encoding="utf-8", errors='ignore')
    data = file.read()
    file.close()
    return data


def write_content_to_file(file_path, content):
    """
    将内容写入并生成文件
    :param file_path: 带文件名和文件后缀的文件全路径
    :param content: 写入的文本内容
    :return:
    """
    file_handle = open(file_path, mode='w')
    file_handle.write(content)
    file_handle.close()

